import React from 'react';
import Input from '../Components/Input';
import ButtonWithProgress
    from '../Components/ButtonWithProgress';
/*

category

 */



const NewProduct = (props) => {
    return (
        <div className='container'>
            <div className='col-xl-9 col-lg-10 col-md-12 col-sm-12 mx-auto'>
                <h1 className='text-center'> Sell Your Product </h1>
                <Input label='Add photo for product' type="file" />
                <Input label='Title' name='title' />

                <select >
                    <option value="">Select category</option>
                </select>

                <div class="form-group">
                    <label >Write an explanation</label>
                    <textarea class="form-control"></textarea>
                </div>

                <Input label='Starting Price' name='startPrice' />
                <Input label='Sell Now Price' name='sellNowPrice' />
                <Input label='End Date' name='endDate' type='datetime-local' />

                <div className='text-center'>
                    <ButtonWithProgress />
                </div>
            </div>
        </div>
    );
};

export default NewProduct;
